import React from 'react';
import {PTitle, Body, Core, Header, Flavor, Portal, TitleBar,
        Tools, Text} from './style';
import {Buttons, HotButton} from '../Components/Body';

export class MusicMajik extends React.Component {  
  componentDidMount() {
    window.scrollTo(0, 0)
  };
  render() {
    return (
      <React.Fragment>
        <span id="top"/>
        <TitleBar>
          <PTitle>Music Magik</PTitle>
          <Flavor>Organize you music... Fast...</Flavor>
        </TitleBar>
        <Core>
          <Body>
            <Portal src="https://spotify-organizer-web.herokuapp.com/" width="540" height="400"></Portal>
            <Buttons>
              <a href='https://spotify-organizer-web.herokuapp.com/' target='_blank'><HotButton>Visit</HotButton></a>
              <a href='https://github.com/gregoryblood/spotifyApp' target='_blank'><HotButton>GitHub</HotButton></a>
            </Buttons>
            <Header>
              About
            </Header>
            <Tools>ReactJS (HTML5/CSS3/JS) - Express</Tools>
            <Text>

            </Text>
            <Header>
              What I Learned
            </Header>
            <Tools>API calls with queries - OAuth - Web hosting with Express</Tools>
            <Text>
              This was my first site that I wanted to deploy, use, and share. It was 
              also the first time I used APIs. It was a lot to learn but it wasn't 
               too hard to implement since the project itself was simple. 
            </Text>
          </Body>
        </Core>
      </React.Fragment>
    );
  };
}

export default MusicMajik;
